import React from 'react'
import UserCard from './UserCard';
import { useSelector } from 'react-redux';
import Adduser from './Adduser';


function Userlist({ping,setping}) {

const users = useSelector((state) => state.user.userlist);
console.log(users);
  return (
    <>
    <div className="adduser">
      <h2 style={{fontSize:"25px",fontWeight:"bold",margint}}>Movie-Cards</h2>
      <Adduser ping={ping} setping={setping}/>
    </div>
    <div className="cards" style={{display:"grid",gridTemplateColumns:"1fr 1fr 1fr",gap:"50px",placeItems:"center",marginTop:"60px"}}>
   {users?.map((el) => <UserCard user={el}/>)}
    </div>
    </>
  );
}

export default Userlist;
